import { Component } from '@angular/core';
import { MihttpService } from '../mihttp.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-registro',
  templateUrl: './registro.component.html',
  styleUrls: ['./registro.component.css']
})
export class RegistroComponent {

  error: string;

  constructor(private http: MihttpService, private router: Router) { 
    this.error = ""
  }

  public registro(correo: string, contraseña: string, nombre: string, direccion: string){

    var body = {
      correo: correo,
      contraseña: contraseña,
      nombre: nombre,
      foto: "",
      direccion: direccion
    }

    this.http.registrarse(body).subscribe({
      next: (data: any) => {
        console.log(data);
        this.router.navigate(["/login"]);
       },
      error: (error: any) => {
        console.log(error);
        this.error = "Correo ya registrado"
      }

    })




  }

}
<body>
    <button id="btn-menu" routerLink="/inicio">Volver</button>
    <div class="register-container">
        <div class="register">
            <p id="title">Registro</p>
            <div class="dos">
                <input #name id="name" placeholder="Nombre">
                <input #password id="password" placeholder="Contraseña" type="password">
            </div>
            <input #mail id="mail" placeholder="Correo">
            <input #direccion id="direccion" placeholder="Direccion">
            <button (click)="registro(mail.value, password.value, name.value, direccion.value)" id="btn">Registrarse</button>
            <p style="color: red;">{{error}}</p>
            <a id="link" routerLink="/login">¿Ya tenés cuenta?</a>
        </div>

    </div>



</body>
